import React from 'react';
import { Col, ListGroup } from 'react-bootstrap';

const ListKategori = ({keranjangs}) => {
	return(
		<Col md={3} mt="2">
			<h4><strong>Hasil</strong></h4>
			<hr />
			<ListGroup>
				{ keranjangs && keranjangs.map((keranjang => {
					return(<ListGroup.Item key={keranjang.id}>Cras justo odio</ListGroup.Item>)
				}))}
			</ListGroup>
		</Col>
	)
}

export default ListKategori;
